import React from 'react';
import './styling/Banner.css'; // Optional: if you want to add specific styles for the banner

const Banner: React.FC = () => {
  return (
    <div className="Banner">
      <h1>Welcome to My Website</h1>
      <p>This is the banner at the top of the home page.</p>
    </div>
  );
};

export default Banner;
